To add any item to the game (including weapons), you will first have to define the item in a data file. These files are located in assets/items and will typically have the same name as the item's id. Since we are creating a sniper rifle, we can give this file the name sniper_rifle.json. This path to the file must also be added to assets/items.json, so that the game will know where to look for it. This is done by simply adding the path (relative to items.json) to the array within the file. In this case, the path that we add will be items/sniper_rifle.json. [ ... "items/sniper_rifle.json",
] Now, it is time to define the weapons parameters inside the sniper_rifle.json file. Begin by creating a new object using curly braces and adding the item's id (sniper_rifle), it's display name (Sniper Rifle) and the item's type (weapon): ...
{ "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon",
}
... The item will need a collider defined for it. A collider is a rectangular boundary around the position of the item that is used for checking whether a player is close enough to pick it up. We'll set the collider for the sniper rifle to be a 16 by 16 box. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 16, "y": 16 },
} This is all the required data for the item part (ItemParams) of our definition. Next, we need to add the parameters required for weapon items.

