We have quite a few options for customization that can be explored by looking at the WeaponParams struct in the source code. First we'll add any attributes for the weapon that describe it's behavior. As we said at the beginning of the section, we wanted the sniper rifle to have high recoil, and 2 uses. We can add these to sniper_rifle.json. We'll set uses to 2 so that the sniper rifle can be shot twice and we'll set recoil to 1400 so that the player will be knocked back significantly when the gun is fired. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 16, "y": 16 }, "uses": 2, "recoil": 14.0,
} Next we'll need to define more subtle values that also will effect the behavior of the sniper rifle weapon: cooldown and attack_duration. cooldown is a period of time that governs how frequently the weapon can be used and attack_duration is the amount of time the player is locked in the attack state (input blocked) when the weapon is used. For the sniper rifle we'll set cooldown to 1.5 and attack_duration to 1.0. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "sprite": { "texture": "musket" }, "collider_size": { "x": 16, "y": 16 }, "uses": 2, "recoil": 14.0, "cooldown": 1.5, "attack_duration": 1.0,
