} Next we'll define the active effects (ActiveEffectParams) of the weapon, or in other words, what happens when the weapon is used. In this case, we want the sniper rifle to shoot a projectile, so we will put projectile in the type field under effects. Then, also under effects we need to define the projectile effect. First we'll set the projectile's type to sprite and define the sprite with a texture of the already existing small_projectile with a size of 8 by 4. Here, we can also give the projectile a tint. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 16, "y": 16 }, "uses": 2, "recoil": 14.0, "cooldown": 1.5, "attack_duration": 1.0, "sound_effect": "shoot", "effects": { "type": "projectile", "projectile": { "type": "sprite", "sprite": { "texture": "small_projectile", "size": { "x": 8, "y": 4 }, "tint": { "r": 0.9, "g": 0.75, "b": 0.12, "a": 1.0 } } }, },
} This is the place where we can implement the remaining attributes that we outlined at the top of the file: high bullet speed, and high range. We'll give the projectile a range of 600 and a speed of 25. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 16, "y": 16 }, "uses": 2, "recoil": 14.0, "cooldown": 1.5, "attack_duration": 1.0, "sound_effect": "shoot", "effects": { "type": "projectile", "projectile": { "type": "sprite", "sprite": { "texture": "small_projectile", "size": { "x": 8, "y": 4 }, "tint": { "r": 0.9, "g": 0.75, "b": 0.12, "a": 1.0 } } }, "range": 600.0, "speed": 25.0 },
} The next step is to add the animation for the sniper rifle weapon to the json object. For now, we will give the sniper the same animation as the musket. We can set the texture of the animation to musket and define the idle and attack animation sequences by providing a row in the spritesheet, the amount of frames in the animation, and the speed (fps: frames per second) of the animation. By default, the animation with an id of idle will be used when an item is on the ground, unless overridden by adding an animation with the id ground. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 64, "y": 24 }, "uses": 2, "cooldown": 1.5, "attack_duration": 1.0, "recoil": 14.0, "sound_effect": "shoot", "effect_offset": { "x": 64, "y": 16 }, "effects": { "type": "projectile", "projectile": { "type": "sprite", "sprite": { "texture": "small_projectile", "size": { "x": 8, "y": 4 }, "tint": { "r": 0.9, "g": 0.75, "b": 0.12, "a": 1.0 } } }, "range": 600.0, "speed": 25.0 }, "animation": { "texture": "musket", "autoplay_id": "idle", "animations": [ { "id": "idle", "row": 0, "frames": 1, "fps": 1 }, { "id": "attack", "row": 1, "frames": 3, "fps": 15 } ] }
} The last thing that we need to add to the json object definition of the sniper rifle weapon is an effect_animation. This is a visual effect that is shown. For the sniper rifle, we want to see a "blast" effect from the end of the barrel of the sniper when the weapon is used (just like for the musket). To implement this we can add effect_animation to the json object. First, we can set the texture to musket and provide an animation called attack with the correct row, frames, and fps. { "id": "sniper_rifle", "name": "Sniper Rifle", "type": "weapon", "collider_size": { "x": 64, "y": 24 }, "uses": 2, "cooldown": 1.5, "attack_duration": 1.0, "recoil": 14.0, "sound_effect": "shoot", "effect_offset": { "x": 64, "y": 16 }, "effects": { "type": "projectile", "projectile": { "type": "sprite", "sprite": { "texture": "small_projectile", "size": { "x": 8, "y": 4 }, "tint": { "r": 0.9, "g": 0.75, "b": 0.12, "a": 1.0 } } }, "range": 600.0, "speed": 25.0 }, "animation": { "texture": "musket", "autoplay_id": "idle", "animations": [ { "id": "idle", "row": 0, "frames": 1, "fps": 1 }, { "id": "attack", "row": 1, "frames": 3, "fps": 15 } ] }, "effect_animation": { "texture": "musket", "animations": [ { "id": "attack", "row": 2, "frames": 4, "fps": 12 } ] }
} If you like, you can skip to the testing section to test your new weapon, but if you haven't added a new texture or modified an existing texture, you will not be able to visually recognize your item before picking it up. For this reason, I recommend you continue to the Texture section next.

